"Zulu\"}}],\"defaultAudioTrackIndex\":0}},\"videoDetails\":{\"videoId\":\"HSTKcGieq6E\",\"title\":\"David Cay Johnston: Living In Trump's America\",\"lengthSeconds\":\"4078\",\"keywords\":[\"David Cay Johnston\",\"Trump's America\",\"Trump Administration\",\"FInances\",\"Health Care\",\"Safety\",\"Donald Trump\",\"San Francisco\",\"Commonwealth Club of California\",\"U.S. politics\"],\"channelId\":\"UC78euTMh9KcVbql3UeWOqBw\",\"isOwnerViewing\":false,\"shortDescription\":\"While Twitter feuds and Russian hackers dominate news headlines, President Donald Trump’s administration is radically changing the policies and programs that define the American way of life. In their first year, the Trump administration’s efforts to defund Obamacare, repeal LGBT protections in the workplace, impose tax cuts and deport undocumented immigrants have significantly impacted millions of Americans, all while the mainstream media has struggled to keep up. Beyond the tweets, firings, scandals and indictments, how will Trump’s policy agenda continue to affect our daily lives?\\n\\nPulitzer Prize-winning journalist David Cay Johnston says he has the answers. Since 1988, Johnston has been chronicling Trump’s personal life and business dealings—from his casinos to his marriages and beyond. In his new book, It’s Even Worse Than You Think, Johnston is going where the media won’t—into the weeds—to shed new light on the Trump administration’s policies and bureaucratic choices and how they will change America. Join Johnston for a revealing conversation about the Trump administration’s impact on our finances, health care, safety and much, much more.\",\"isCrawlable\":true,\"thumbnail\":{\"thumbnails\":[{\"url\":\"https:\/\/i.ytimg.com\/vi\/HSTKcGieq6E\/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLDAPnuwRgkujX76tNooKL9uzT8iRQ\",\"width\":168,\"height\":94},{\"url\":\"https:\/\/i.ytimg.com\/vi\/HSTKcGieq6E\/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAA rump's America\"},\"description\":{\"simpleText\":\"While Twitter feuds and Russian hackers dominate news headlines, President Donald Trump’s administration is radically changing the policies and programs that define the American way of life. In their first year, the Trump administration’s efforts to defund Obamacare, repeal LGBT protections in the workplace, impose tax cuts and deport undocumented immigrants have significantly impacted millions of Americans, all while the mainstream media has struggled to keep up. Beyond the tweets, firings, scandals and indictments, how will Trump’s policy agenda continue to affect our daily lives?\\n\\nPulitzer Prize-winning journalist David Cay Johnston says he has the answers. Since 1988, Johnston has been chronicling Trump’s personal life and business dealings—from his casinos to his marriages and beyond. In his new book, It’s Even Worse Than You Think, Johnston is going where the media won’t—into the weeds—to shed new light on the Trump administration’s policies and bureaucratic choices and how they will change America. Join Johnston for a revealing conversation about the Trump administration’s impact on our finances, health care, safety and much, much more.\"},\"lengthSeconds\":\"4079\",\"ownerProfileUrl\":\"http:\/\/www.youtube.com\/user\/commonwealthclub\",\"externalChannelId\":\"UC78euTMh9KcVbql3UeWOqBw\",\"isFamilySafe\":true,\"availableCountries\":[\"AD\",\"AE\",\"AF\",\"AG\",\"AI\",\"AL\",\"AM\",\"AO\",\"AQ\",\"AR\",\"AS\",\"AT\",\"AU\",\"AW\",\"AX\",\"AZ\",\"BA\",\"BB\",\"BD\",\"BE\",\"BF\",\"BG\",\"BH\",\"BI\",\"BJ\",\"BL\",\"BM\",\"BN\",\"BO\",\"BQ\",\"BR\",\"BS\",\"BT\",\"BV\",\"BW\",\"BY\",\"BZ\",\"CA\",\"CC\",\"CD\",\"CF\",\"CG\",\"CH\",\"CI\",\"CK\",\"CL\",\"CM\",\"CN\",\"CO\",\"CR\",\"CU\",\"CV\",\"CW\",\"CX\",\"CY\",\"CZ\",\"DE\",\"DJ\",\"DK\",\"DM\",\"DO\",\"DZ\",\"EC\",\"EE\",\"EG\",\"EH\",\"ER\",\"ES\",\"ET\",\"FI\",\"FJ\",\"FK\",\"FM\",\"FO\",\"FR\",\"GA\",\"GB\",\"GD\",\"GE\",\"GF\",\"GG\",\"GH\",\"GI\",\
